import React, {useState} from "react";
import "./Navbar.css"

export default function Navbar () {
    const [click, setClick] = useState(false)

    function handleHamburgerMenu() {
        setClick(prevMenuIcon => !prevMenuIcon)
    }

   function menuClose() {
    setClick(false)
   }


    return (
      <div className="navbar">
        <h2 className="logo">
          travel<i class="uil uil-swiggy"></i>
        </h2>
        <div className="hamburger-menu" onClick={handleHamburgerMenu}>
          <i
            className={click ? "uil uil-multiply" : "uil uil-draggabledots"}
          ></i>
        </div>
        <ul className={click? "menu-items active" : "menu-items"}>
          <li onClick={menuClose}>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Trips</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </div>
    );
}
